select * from (select * from (select l_orderkey, sum(l_extendedprice*(1-l_discount)) as revenue, o_orderdate, o_shippriority
from (select * from lineitem where ((l_orderkey >= 3284706) AND (l_orderkey < 3446919)) OR ((l_orderkey >= 4762242) AND (l_orderkey < 4914213)) OR ((l_orderkey >= 9700901) AND (l_orderkey < 9852867)) OR ((l_orderkey >= 16352711) AND (l_orderkey < 16505569)) OR ((l_orderkey >= 22688000) AND (l_orderkey < 22838722)) OR ((l_orderkey >= 23757029) AND (l_orderkey < 23919909)) OR ((l_orderkey >= 46582785) AND (l_orderkey < 46727297)) OR ((l_orderkey >= 52832320) AND (l_orderkey < 52992768)) OR ((l_orderkey >= 59253317) AND (l_orderkey < 59396576)) ) ll,
(select * from orders where ((o_orderkey >= 3343170) AND (o_orderkey < 3483559)) OR ((o_orderkey >= 4714531) AND (o_orderkey < 4863523)) OR ((o_orderkey >= 9769540) AND (o_orderkey < 9933858)) OR ((o_orderkey >= 16340581) AND (o_orderkey < 16479168)) OR ((o_orderkey >= 22657891) AND (o_orderkey < 22816389)) OR ((o_orderkey >= 23724231) AND (o_orderkey < 24030853)) OR ((o_orderkey >= 46556416) AND (o_orderkey < 46690081)) OR ((o_orderkey >= 52858983) AND (o_orderkey < 53001219)) OR ((o_orderkey >= 59273249) AND (o_orderkey < 59407652)) ) oo,
(select * from customer where ((c_custkey >= 170592) AND (c_custkey < 174383)) OR ((c_custkey >= 301064) AND (c_custkey < 304951)) OR ((c_custkey >= 445907) AND (c_custkey < 449859)) OR ((c_custkey >= 513264) AND (c_custkey < 516982)) OR ((c_custkey >= 631537) AND (c_custkey < 635122)) OR ((c_custkey >= 654034) AND (c_custkey < 657836)) OR ((c_custkey >= 710536) AND (c_custkey < 713925)) OR ((c_custkey >= 766291) AND (c_custkey < 770291)) OR ((c_custkey >= 830761) AND (c_custkey < 834330)) OR ((c_custkey >= 1320326) AND (c_custkey < 1324366)) ) cc
where c_mktsegment = 'BUILDING' and c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate < '1995-03-15' and l_shipdate > '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority) l2 order by revenue desc, o_orderdate) l1 limit 10;
